 const cart = useSelector(state => state.cart)

 useEffect(() => {
    fetch('https://redux-project-9df01-default-rtdb.firebaseio.com/cart.json')
 }, [])

  return (
    <Layout>
      {isVisible && <Cart />}
      <Products />
